{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/sergioalvpe/google-data-analytics-capstone-cyclistic?scriptVersionId=160882722\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"3d26706f","metadata":{"papermill":{"duration":0.005219,"end_time":"2024-01-29T14:55:06.627648","exception":false,"start_time":"2024-01-29T14:55:06.622429","status":"completed"},"tags":[]},"source":["\n","## Case Study 1: How does a bike-share navigate speedy success?\n","### This is the capstone case study for the course 8 of the Google Data Analytics Professional Certificate\n","\n","## Case\n","You are a junior data analyst working on the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes diferently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But frst, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","\n","\n","The comapy wants to aswert this 3 quiestion for the future marketing program based on the dataset:\n","\n","1. How do annual members and casual riders use Cyclistic bikes diferently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to infuence casual riders to become members?"]},{"cell_type":"markdown","id":"ac81ea3c","metadata":{"papermill":{"duration":0.004392,"end_time":"2024-01-29T14:55:06.636573","exception":false,"start_time":"2024-01-29T14:55:06.632181","status":"completed"},"tags":[]},"source":["# Roadmap: \n","## Ask\n","\n","Lily Moreno, the director of marketing belives that there is a solid opportunity to convert casual ridesr into members since annual members are much more profitable than casual riders. The task is to compare how members and casual riders are using the bicycles and find relevant insights that helps support Moreno's beliefs. For that it is necesary to compare how often members and casual riders are using the service."]},{"cell_type":"markdown","id":"3e1ca749","metadata":{"papermill":{"duration":0.004456,"end_time":"2024-01-29T14:55:06.645432","exception":false,"start_time":"2024-01-29T14:55:06.640976","status":"completed"},"tags":[]},"source":["## Prepare\n","\n","The data was taken from https://divvy-tripdata.s3.amazonaws.com/index.html. The data is reliable, original, comprehensive, current and cited, since it is an hypothetical case provided by the Coursera course. \n","\n","* The analysis was done using RStudio.\n","* To prepare the data, \"tidyverse\" package was intalled."]},{"cell_type":"code","execution_count":1,"id":"f2cd1ab2","metadata":{"execution":{"iopub.execute_input":"2024-01-29T14:55:06.657394Z","iopub.status.busy":"2024-01-29T14:55:06.655888Z","iopub.status.idle":"2024-01-29T14:56:07.795378Z","shell.execute_reply":"2024-01-29T14:56:07.794014Z"},"papermill":{"duration":61.148196,"end_time":"2024-01-29T14:56:07.798054","exception":false,"start_time":"2024-01-29T14:55:06.649858","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Warning message:\n","“unable to access index for repository http://cran.rstudio.com/src/contrib:\n","  cannot open URL 'http://cran.rstudio.com/src/contrib/PACKAGES'”\n","Warning message:\n","“package ‘tidyverse’ is not available for this version of R\n","\n","A version of this package for your version of R might be available elsewhere,\n","see the ideas at\n","https://cran.r-project.org/doc/manuals/r-patched/