ed(all_trips_v2$day_of_week, levels=c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))\n","\n","# Now, let's run the average ride time by each day for members vs casual users\n","aggregate(all_trips_v2$ride_length ~ all_trips_v2$member_casual + all_trips_v2$day_of_week, FUN = mean)\n","\n","# analyze ridership data by type and weekday\n","all_trips_v2 %>% \n","  mutate(weekday = wday(started_at, label = TRUE)) %>%  #creates weekday field using wday()\n","  group_by(member_casual, weekday) %>%  #groups by usertype and weekday\n","  summarise(number_of_rides = n()\t\t\t\t\t\t\t#calculates the number of rides and average duration \n","            ,average_duration = mean(ride_length)) %>% \t\t# calculates the average duration\n","  arrange(member_casual, weekday)\t\t\t\t\t\t\t\t# sorts\n"]},{"cell_type":"markdown","id":"036b8e48","metadata":{"papermill":{"duration":0.012562,"end_time":"2024-01-29T14:59:52.856006","exception":false,"start_time":"2024-01-29T14:59:52.843444","status":"completed"},"tags":[]},"source":["## Share\n","### Visualization \n","\n","To understand the tables above a little better, visualizations of the insights were made.\n","\n","* The 1.) firts visualization depicts the ride frequency across different days of the week, highlighting a notable trend in user behavior. Specifically, members tend to utilize Cyclistic more frequently than casual riders in general. However, a distinct pattern emerges: members riders predominantly engage with Cyclistic on weekdays, whereas casual riders use the service more during weekends (among casual riders). "]},{"cell_type":"code","execution_count":9,"id":"7fee066c","metadata":{"execution":{"iopub.execute_input":"2024-01-29T14:59:52.884467Z","iopub.status.busy":"2024-01-29T14:59:52.883009Z","iopub.status.idle":"2024-01-29T15:00:04.805511Z","shell.execute_reply":"2024-01-29T15:00:04.803909Z"},"papermill":{"duration":11.938919,"end_time":"2024-01-29T15:00:04.807523","except