rketing efforts with a weekend-focused campaign, capitalizing on the peak usage of Cyclistic by casual riders during this timeframe. Tailoring promotions to align with their preferred usage patterns can enhance engagement.\n","\n","3. Leverage social media platforms for targeted marketing, specifically focusing on the 26 to 34 age group, which constitutes the majority of casual riders. Choose popular social media channels within this age range to maximize the impact and reach of the campaign.\n","\n"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":4367764,"sourceId":7500713,"sourceType":"datasetVersion"},{"datasetId":4368030,"sourceId":7501146,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":366.233847,"end_time":"2024-01-29T15:01:10.536476","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-01-29T14:55:04.302629","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}